import './App.css';
import Navbar from './components/Navbar/Navbar';
import ItemListContainer from './components/ItemListContainer/ItemListContainer';
import ItemDetailContainer from './components/ItemDetailContainer/ItemDetailContainer';
import { useState, createContext } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom'
import { CartContextProvider } from './context/CartContext'
import { UserContextProvider} from './context/UserContext'
import Cart from './components/CartWidget/Cart';
import CartWidget from './components/CartIcon/CartWidget';


function App() {
  // const handleOnAdd = (quantity)=> {
  //   console.log('La cantidad de productos seleccionados es', quantity)
  // }

  return (
    <div className="App">
      <UserContextProvider>
      <CartContextProvider>
        <BrowserRouter>
          <header className="App-header">

            <Navbar/>
            <Routes>
              <Route path='/' element={ <ItemListContainer greeting="Bienvenido a mi E-Commerce en desarrollo :)" />}/>
              <Route path='/category/:categoryId' element={<ItemListContainer greeting="Estamos filtrando" />} />
              <Route path='/detail/:productId' element={<ItemDetailContainer />}/>
              <Route path='/cart' element={<Cart/>}/>
            </Routes>
          </header>
        </BrowserRouter>
      </CartContextProvider>
      </UserContextProvider>
    </div>

  );
}

export default App;
